@Injectable({
  providedIn: 'root'
})
export class CharactersService {

  constructor(private http:HttpClient) { }
  getCharacters():Observable<PersonajesRyM>{
    return  this.http.get<PersonajesRyM>('   https://rickandmortyapi.com/api/character');


  }
}
